// App.js
import React from 'react';

import './styles/main.css';

import LandingPage from './components/LandingPage';
import Fireworks from './components/Fireworks';
import FireworksJourney from './components/FireworksJourney';
import Greeting from './components/Greeting';
import Timeline from './components/Timeline';
import FutureLetter from './components/FutureLetter';
import Gallery from './components/Gallery';
import Playlist from './components/Playlist';
import InspirationalQuote from './components/InspirationalQuote';
import FunFact from './components/FunFact';

import ParticleBackground from './components/ParticleBackground';



function App() {
  const contentRef = React.useRef(null);

  const handleScrollToContent = () => {
    if (contentRef.current) {
      contentRef.current.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div className="App" style={{position: 'relative', minHeight: '100vh', overflow: 'hidden'}}>
      <ParticleBackground />
      <Fireworks />
      <LandingPage onScrollToContent={handleScrollToContent} />
      <div
        ref={contentRef}
        className="main-section-glow"
        style={{
          padding: '3.5rem 0 2.5rem 0',
          background: 'linear-gradient(135deg, #1e3c72 0%, #2a5298 60%, #a18cd1 100%)',
          position: 'relative',
          zIndex: 2,
          minHeight: '100vh',
          boxShadow: '0 0 80px 0 #1e3c72cc',
        }}
      >
        <InspirationalQuote />
        <FunFact />
        <FireworksJourney />
        <div className="main-container main-journey-glow" style={{position: 'relative', zIndex: 2, maxWidth: 700, margin: '0 auto', background: 'rgba(30,60,114,0.10)', borderRadius: 24, boxShadow: '0 4px 32px #1e3c7233, 0 0 32px 4px #a18cd144', padding: '2.5rem 1.2rem 2.2rem 1.2rem'}}>
          <div style={{marginBottom: '0.5rem', textAlign: 'center'}}>
            <span style={{fontSize: '2.7rem', display: 'block', filter: 'drop-shadow(0 0 12px #ffd20099)'}}>üéÜ</span>
          </div>
          <h2 style={{
            fontSize: '2.3rem',
            fontWeight: 800,
            color: '#fff',
            letterSpacing: '-1.5px',
            marginBottom: '0.7rem',
            textShadow: '0 2px 16px #23294699, 0 1px 0 #6dd5ed',
            textAlign: 'center',
            filter: 'drop-shadow(0 0 12px #6dd5ed88)'
          }}>Your 2025 Journey</h2>
          <div style={{fontSize: '1.18rem', color: '#b5eaff', margin: '0.7rem 0 1.2rem 0', fontStyle: 'italic', fontWeight: 400, textAlign: 'center', textShadow: '0 1px 8px #23294655'}}>
            Setiap momen adalah kenangan, setiap langkah adalah harapan.
          </div>
          <div style={{margin: '1.5rem 0 2.2rem 0'}}>
            <div style={{
              fontSize: '1.22rem',
              color: '#fff',
              fontStyle: 'italic',
              margin: '0 0 1.3rem 0',
              lineHeight: 1.6,
              textAlign: 'center',
              maxWidth: 520,
              marginLeft: 'auto',
              marginRight: 'auto',
              marginTop: 0,
              textShadow: '0 1px 8px #23294655',
            }}>
              <div>‚ÄúHidup adalah kumpulan momen kecil yang layak dirayakan.‚Äù</div>
              <div>‚ÄúJangan takut melangkah, setiap langkah adalah cerita.‚Äù</div>
              <div>‚ÄúSemoga tahun ini membawa lebih banyak tawa dan harapan.‚Äù</div>
            </div>
            <div style={{
              fontSize: '1.13rem',
              color: '#b5eaff',
              margin: '1.7rem 0 2.2rem 0',
              fontStyle: 'italic',
              fontWeight: 400,
              textAlign: 'center',
              opacity: 1,
              textShadow: '0 1px 8px #23294655',
            }}>
              Terima kasih sudah menjadi bagian dari perjalanan ini.
            </div>
            <div style={{width: 90, height: 3, background: 'linear-gradient(90deg, #6dd5ed, #a18cd1)', borderRadius: 2, opacity: 0.7, margin: '2.2rem auto 2.2rem auto'}} />
          </div>
          {/* <FutureLetter /> */}
          <Gallery />
          <Playlist />
        </div>
      </div>
    </div>
  );
}

export default App;
